import React, { Component } from "react";
import LoginSection from "./LoginSection";

class LoginPage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <>
        <LoginSection />
        <Clock/>
      </>
    );
  }
}

export default LoginPage;
